// src/Orders.js
import React, { useEffect } from 'react';
import './dashboard.css'; // Ensure the filename matches exactly

const Orders = () => {
  useEffect(() => {
    console.log("Orders component mounted");
  }, []);

  return (
    <div className="orders-page">
      {/* Simple Header for the Orders page */}
      <h2 className="mt-3 mb-3">Order Management</h2>

      {/* Orders Table */}
      <table className="table table-striped">
        <thead>
          <tr>
            <th>Products</th>
            <th>Quantity</th>
            <th>Order ID</th>
            <th>Expected Delivery</th>
            <th>Status</th>
          </tr>
        </thead>
        <tbody>
          <tr>
            <td>Chicken, Lettuce</td>
            <td>43, 12, 20</td>
            <td>7535</td>
            <td>11/12/22</td>
            <td className="text-warning">Pending</td>
          </tr>
          <tr>
            <td>Chips, Fries, Brussel Sprout</td>
            <td>22, 13, 14</td>
            <td>5724</td>
            <td>21/12/22</td>
            <td className="text-success">Delivered</td>
          </tr>
          <tr>
            <td>Red Bull, Monster, Gatorade</td>
            <td>36, 20, 20</td>
            <td>2775</td>
            <td>5/12/22</td>
            <td className="text-danger">Returned</td>
          </tr>
        </tbody>
      </table>
    </div>
  );
};

export default Orders;
